import ExcelJS from "exceljs";
import { saveAs } from "file-saver";
import { IVehicleReport } from "../components/TempReport";
import moment from "moment";
import { preDistance } from "./preDistance";
import { analog } from "./Analog";
import logo from "../images/logo.png";
import { style } from "@mui/system";
const statusEnToth = (str: string): string => {
  switch (str) {
    case "ENGINE OFF":
      return "ดับเครื่องยนต์";
    case "ENGINE ON":
      return "ติดเครื่องยนต์";
    case "OFFLINE":
      return "ไม่มีสัญญาน";
    case "IDLE":
      return "จอดติดเครื่องยนต์";
    case "SPEEDING":
      return "ความเร็วเกินกำหนด";
    case "LOCATION":
      return "โลเคชั่น";
    case "NORMAL":
      return "สถานะปกติ";
    default:
      return "ไม่สามารถระบุได้";
  }
};

export default async function <T extends IVehicleReport>(
  apiData: T[],
  fileName: string,
  fleetName: string | undefined,
  min1: string,
  max1: string,
  averageTemp1: string,
  min2: string,
  max2: string,
  averageTemp2: string
) {
  // Config work book
  const workbook = new ExcelJS.Workbook();
  workbook.creator = "Me";
  workbook.lastModifiedBy = "Her";
  workbook.created = new Date(1985, 8, 30);
  workbook.modified = new Date();
  workbook.lastPrinted = new Date(2016, 9, 27);

  // convert regular image to bash64 string
  const myBase64Image =
    "data:image/png;base64,";
  // initialize image to workbook
  const imageId2 = workbook.addImage({
    base64: myBase64Image,
    extension: "png",
  });

  const worksheet = workbook.addWorksheet("Temp report");

  // add image to work sheet to following cells
  worksheet.addImage(imageId2, `A1:B5`);

  // columns
  /*Column headers*/
  const header = worksheet.getRow(9);
  header.values = [
    "ลำดับ",
    "สถานะ",
    "สถานที่",
    "เวลา",
    "ละติจูด",
    "ลองติจูด",
    "ความเร็ว",
    "น้ำมัน",
    "อุณหภูมิ1",
    "อุณหภูมิ2",
    "ระยะทาง",
  ];
  header.border = {
    top: { style: "thin" },
    left: { style: "thin" },
    bottom: { style: "thin" },
    right: { style: "thin" },
  };
  header.fill = {
    type: "pattern",
    pattern: "solid",
    fgColor: { argb: "F08080" },
  };
  header.alignment = {
    horizontal: "center",
  };

  worksheet.columns = [
    {
      key: "ลำดับ",
      width: 5,
    },
    {
      key: "สถานะ",
      width: 15,
    },
    {
      key: "สถานที่",
      width: 80,
    },
    {
      key: "เวลา",
      width: 20,
    },
    {
      key: "ละติจูด",
      width: 10,
    },
    {
      key: "ลองติจูด",
      width: 10,
    },
    {
      key: "ความเร็ว",
      width: 10,
    },
    {
      key: "น้ำมัน",
      width: 8,
    },
    {
      key: "อุณหภูมิ1",
      width: 10,
    },
    {
      key: "อุณหภูมิ2",
      width: 10,
    },
    {
      key: "ระยะทาง",
      width: 10,
    },
  ];

  // rows arrray with coresponding with column name respectively
  const row = apiData.map((row, i) => ({
    ลำดับ: i + 1,
    สถานะ: statusEnToth(row.Status),
    สถานที่: row.name,
    เวลา: moment.utc(row.local_timestamp).format("DD-MM-YYYY HH:mm:ss"),
    ละติจูด: parseFloat(row.lat).toFixed(5),
    ลองติจูด: parseFloat(row.lon).toFixed(5),
    ความเร็ว: row.speed,
    น้ำมัน: analog(
      row.max_fuel_voltage,
      row.max_fuel,
      row.analog,
      row.max_empty_voltage
    ),
    อุณหภูมิ1: row.Temp1,
    อุณหภูมิ2: row.Temp2,
    ระยะทาง:
      row.distance === null
        ? preDistance(apiData, i)
        : parseFloat(row.distance).toFixed(3),
  }));

  // const rows = [[3, "Alex", "44"], { id: 4, name: "Margaret", age: 32 }];

  // insert row array
  worksheet.mergeCells("C1:K2");
  const Temp = worksheet.getCell("D1");
  Temp.font = {
    name: "Comic Sans MS",
    family: 4,
    size: 20,
    bold: true,
  };
  Temp.alignment = {
    horizontal: "center",
  };
  Temp.value = "รายงานอุณหภูมิ";

  //Fleet
  worksheet.mergeCells("C4:E4");
  worksheet.getCell("C4").value = "กลุ่มยานยนต์ : " + fleetName;

  //Registration
  worksheet.mergeCells("C5:E5");
  worksheet.getCell("C5").value = "ทะเบียน : " + apiData[0].reg_no;

  //Time
  worksheet.mergeCells("I4:K4");
  worksheet.getCell("I4").value = "ช่วงเวลาที่เลือก";

  worksheet.mergeCells("I5:K5");
  worksheet.getCell("I5").value =
    "เวลาเริ่มต้น : " +
    moment.utc(apiData[0].local_timestamp).format("DD-MM-YYYY HH:mm:ss");

  worksheet.mergeCells("I6:K6");
  worksheet.getCell("I6").value =
    "เวลาสิ้นสุด : " +
    moment
      .utc(apiData[apiData.length - 1].local_timestamp)
      .format("DD-MM-YYYY HH:mm:ss");

  //Temp1
  worksheet.mergeCells("C6:G6");
  worksheet.getCell("C6").value =
    "อุณหภูมิ 1" +
    "     อุณหภูมิสูงสุด : " +
    max1 +
    " เซลเซียส" +
    "   อุณหภูมิต่ำสุด : " +
    min1 +
    " เซลเซียส" +
    "   อุณหภูมิเฉลี่ย : " +
    averageTemp1 +
    " เซลเซียส";

  //Temp2
  worksheet.mergeCells("C7:G7");
  worksheet.getCell("C7").value =
    "อุณหภูมิ 2" +
    "     อุณหภูมิสูงสุด : " +
    max2 +
    " เซลเซียส" +
    "   อุณหภูมิต่ำสุด : " +
    min2 +
    " เซลเซียส" +
    "   อุณหภูมิเฉลี่ย : " +
    averageTemp2 +
    " เซลเซียส";

  worksheet.addRows(row);

  for (let n = 10; n < apiData.length + 10; n++) {
    worksheet.getRow(n).border = {
      top: { style: "thin" },
      left: { style: "thin" },
      bottom: { style: "thin" },
      right: { style: "thin" },
    };
  }
  // generate excel
  await workbook.xlsx.writeBuffer().then((data) => {
    const blob = new Blob([data], {
      type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=utf-8",
    });
    saveAs(blob, fileName + ".xlsx");
  });
}
